import React from 'react';
// import './WeatherApp.css';

const Form = () => {
	return(
		<form onSubmit = {this.props.loadWeather}>
			<input type="text" name="city" placeholder="City..."/>
			<input type="text" name="country" placeholder="Country..."/>
			<button>Get Weather</button>
		</form>
	);
}

export default Form;
